(function() {
    'use strict';

    angular
        .module('app.dashboard')
        .factory('dashboardService', ['$http', '$location', '$q', 'exception',
          'logger', 'config', dashboardService]);

    /* @ngInject */
    function dashboardService($http, $location, $q, exception, logger, config) {
        var isPrimed = false;
        var primePromise;

        var service = {
            getApplications: getApplications,
            getApplicationCount: getApplicationCount,
            ready: ready
        };

        return service;

        // Replace calls to stubs with $http.get()
        function getApplicationsStub() {
            var applications = [
              {
                name: 'Pawnshop', screenCount: 45, roleCount: 3, dateCreated: '12/13/2015',
                description: 'Asp.Net MVC application used by the City of Des Moines Police Department to track stolen items',
                icon: 'data:image/png;base64,'
              },
              {
                name: 'Rely Builder Canvas', screenCount: 20, roleCount: 1, dateCreated: '12/01/2015',
                description: 'AngularJs application used to assist with the creation of RelyDB applications (how meta)',
                icon: 'data:image/png;base64,'
              },
              {
                name: 'Reddit Live', screenCount: 4, roleCount: 1, dateCreated: '5/10/2015',
                description: 'Native Android application used to view reddit threads in real time',
                icon: 'data:image/png;base64,'
              }
            ]
            return $q(function(resolve, reject) {
              var millisecondsToWait = 500;
              setTimeout(function() {
                  // Whatever you want to do after the wait
                  resolve(applications);
              }, millisecondsToWait);
            });
        }

        function getRandomDesciption() {
          var descs = [
            'Kielbasa tenderloin pork loin ham pork venison pancetta meatball strip steak. Filet mignon pig alcatra brisket capicola drumstick. Beef ribs ground round shoulder shank, alcatra tri-tip sausage pig hamburger short loin filet mignon. Ball tip venison kevin pork salami.',
            'Pastrami kielbasa bacon chicken. Tail pork chop leberkas turducken ham meatloaf filet mignon beef ribs ground round ball tip shankle. Andouille prosciutto ham hock salami drumstick swine strip steak picanha pastrami shoulder kevin cow pork chop fatback. Meatloaf spare ribs alcatra flank. Shankle kevin hamburger chuck beef ribs.',
            'Biltong beef chicken, shank kielbasa tail leberkas bresaola ham. Ground round short loin pig pastrami pork, meatloaf tail ball tip.'
          ];
          var randPos = Math.floor(Math.random() * (descs.length));
          return descs[randPos];
        }

        function getRandomIcon() {
          var icons = [
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,'
          ]
          var randPos = Math.floor(Math.random() * (icons.length));
          return icons[randPos];
        }

        function getApplications() {
            return $http.get(config.apiUrl + '/api/applications')
                .then(getApplicationsComplete)
                .catch(function(message) {
                    exception.catcher('XHR Failed for applications')(message);
              });

            function getApplicationsComplete(data, status, headers, config) {
                data.data.Response.forEach(function(application){
                  if (application.Icon === 'AA==' || !application.Icon) {
                    application.Icon = getRandomIcon();
                  }
                  if (!application.Description) {
                    application.Description = 'No Description';
                  }
                  // application.screenCount = application.screens.length;
                  // application.roleCount = application.roles.length;
                });
                return data.data.Response;
            }
        }

        function getApplicationCount() {
            var count = 0;
            return getApplicationsStub()
                .then(getApplicationCountComplete)
                .catch(exception.catcher('XHR Failed for applications'));

            function getApplicationCountComplete (data) {
                count = data.length;
                return $q.when(count);
            }
        }

        function prime() {
            // This function can only be called once.
            if (primePromise) {
                return primePromise;
            }

            primePromise = $q.when(true).then(success);
            return primePromise;

            function success() {
                isPrimed = true;
                logger.info('Primed data');
            }
        }

        function ready() {

        }

    }
})();
